package easy

fun main() {
    println(firstUniqChar(""))
}

fun firstUniqChar(s: String): Int {
    val hashMap = hashMapOf<Char, Int>()
    s.forEach {
        if(hashMap.containsKey(it)){
            hashMap[it] = hashMap[it]!!.plus(1)
        }else hashMap[it] = 1
    }
    println(hashMap.toList())
    s.forEachIndexed {index, it->
        if(hashMap[it] == 1) return index
    }
    return -1
}